import React from "react";
import Tile from "../tile/Tile";

export const TileList = ({ tiles }) => {
  if (!tiles) return null; // Early return if tiles is undefined

  return (
    <div>
      {tiles.map((tile, index) => (
        <Tile key={index} {...tile} />
      ))}
    </div>
  );
};
